-- ----------------------------
DROP TRIGGER IF EXISTS `updateguest`;
delimiter ;;
CREATE TRIGGER `updateguest` AFTER UPDATE ON `user` FOR EACH ROW BEGIN
UPDATE guest SET guest.avatarurl = new.avatarurl WHERE guest.p_id = old.id;
END
;;
delimiter ;

-- ----------------------------
