DROP TRIGGER IF EXISTS `updatereply Avatarurl`;
delimiter ;;
CREATE TRIGGER `updatereply Avatarurl` AFTER UPDATE ON `user` FOR EACH ROW BEGIN
		UPDATE reply 
		SET reply.avatar = new.avatarurl,
		reply.nickname = new.`name` 
	WHERE
		reply.p_id = old.id;
END
;;
delimiter ;

