INSERT INTO `guest` (`G_id`, `type`, `title`, `G_context`, `tip`, `createtime`, `p_id`, `liked`, `comment`, `watch`, `p_url`, `avatarurl`) VALUES ('4208ac93-e34a-4fc9-987c-59ed62026e67', 'jsjl', 'jmeter测试加密接口', '在做接口测试时，很多时候我们都会碰到带有加密参数的接口，这种接口一般来讲都会有统一的加密方法，找开发要就好，Jmeter怎么去测呢1.整体结构如下所示：2.操作步骤（1）将加密方法打成jar包放在jmeter的lib\\ext目录下；打jar包方法，打开eclipse,选中加密类，点击Export,选择Java下JAR fIle,选择导出目录，点击完成即可（2）点击Jmeter测试计划,Add directory or jar to classpath点击浏览，添加需要调用的jar包（3）在http请求下添加bean shell preprocessor，编写如下测试代码即可（4）将params参数放在Body Data即可', '软件测试', '2022-07-04', '104', '0', '1', '4', 'http://rdrqjc56z.hn-bkt.clouddn.com/2.jpg', 'https://cube.elemecdn.com/3/7c/3ea6beec64369c2642b92c6726f1epng.png');
INSERT INTO `guest` (`G_id`, `type`, `title`, `G_context`, `tip`, `createtime`, `p_id`, `liked`, `comment`, `watch`, `p_url`, `avatarurl`) VALUES ('5412b386-8d1d-45db-b178-4a4eaee0044e', 'shjl', '茶道的意义', '茶道如同君之道，中华历史五千年，茶兴于唐代,盛于宋代,茶起源于中国,茶为国饮,关于茶文化的起源,自由\"茶之为饮,发乎于神农氏,闻与鲁周公,兴于唐,盛于宋,发展与明清\"之说,并且早在隋唐以前就开始有记录,经过历史的发展,时代的不同,地理环境的影响,茶叶早已成为生活的一部分。', '茶道', '2022-07-04', '105', '0', '1', '2', 'http://rdrqjc56z.hn-bkt.clouddn.com/8.jpg', 'https://cube.elemecdn.com/3/7c/3ea6beec64369c2642b92c6726f1epng.png');
