INSERT INTO `guest` (`G_id`, `type`, `title`, `G_context`, `tip`, `createtime`, `p_id`, `liked`, `comment`, `watch`, `p_url`, `avatarurl`) VALUES ('e431d73d-280b-4a2b-bb21-3e5f68f1e715', 'shjl', '油滴在网面鞋子上怎么洗掉？', '网面鞋沾上油渍，可以用以下方法来处理：方法一：1、取适量洗洁精和牙膏，混合均匀；2、涂抹在鞋面油渍处，等渗透到鞋子里面之后用牙刷轻刷，刷好后用清水冲洗干净即可。方法二：1、将肥皂切碎之后放进盛有开水的盆中，等待完全融化；2、用软毛刷或海绵擦蘸取擦洗，再用清水冲洗干净即可。方法三：1、以1:1:50的比例，混合洗洁精、白醋和30-40摄氏度温水；2、浸泡油渍处10分钟，用软毛刷或海绵擦蘸取擦洗，再用清水冲洗干净即可。方法四：1、在油渍处涂抹风油精，放置10分钟；2、用手指轻轻揉搓油渍处，再用肥皂或洗涤剂清洗干净即可。日常清洗网面鞋还需注意：第一、洗干净后避免阳光暴晒，放在阴凉通风处即可；第二、不要用暖气或明火烘干，避免开胶、变色或变形。', '油渍清理,清洗鞋子', '2022-07-04', '116', '0', '1', '4', 'http://rdrqjc56z.hn-bkt.clouddn.com/8.jpg', 'https://cube.elemecdn.com/3/7c/3ea6beec64369c2642b92c6726f1epng.png');
